import { Card,CardActionArea,CardMedia,CardContent, Typography,CardActions,makeStyles, Button, Avatar } from '@material-ui/core';



const useStyles = makeStyles((theme) => ({
  media:{
    height: 250,
    marginTop: 5,
    [theme.breakpoints.down("sm")]:{
      height: 150,
    },
  },
  card:{
    marginBottom: theme.spacing(3),
  },
  tile:{
    height: theme.spacing(40),
    display: "flex",
    margin: 5,
  },
  name:{
    fontSize: 16,
    fontWeight: 500,
    color: "#555",
  },
}));
export default function Post() {
  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <CardActionArea>
        <div className={classes.title}>
          <Avatar />
          <div className={classes.name}>
            Manohisoa
          </div>
        </div>
        <CardMedia className={classes.media} image="https://material-ui.com/static/images/cards/paella.jpg" />
        <CardContent>
          <Typography gutterBottom variant="h5">My first post</Typography>
          <Typography variant="body">Lorem ipsum</Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn more
        </Button>
      </CardActions>
    </Card>
  );
}
